import React from 'react'

function Display({res}) {
    const body = slotInfo => {
        {
            let totalSlotsBooked = 0;
            let totalSlotsEmpty = 0;
            slotInfo.forEach(element => {
                if(element.status === 1){
                    totalSlotsEmpty = totalSlotsEmpty + 1;
                } else {
                    totalSlotsBooked = totalSlotsBooked + 1;
                }
            });
        }
        <div><div>totalSlotsBooked</div>
        <div>totalSlotsEmpty</div></div>       
    }
  return (
    <div>
        <div>Slots Booked</div>
        {res !== null && res.data.courtList.map(val => 
            {
                <div  key = {val.courtId}>
                    <div>val.courtName</div>
                    {body(val.slotInfo)}
                </div>
            })
        }
    </div>
  )
}

export default Display;
